Vẽ đồ thị các điểm, chúng ta thấy kích thước của hình chữ nhật là $x$ và $4$. Diện tích của hình chữ nhật là $(\text{length})(\text{width})=4x$, do đó $4x=28$ và $x=\boxed{7}$. [asy]
kích thước (5cm);
đồ thị nhập khẩu;
defaultpen(linewidth(0.7)+fontsize(12));
x thực = 7;
cặp A=(0,0), B=(0,4), C=(x,4), D=(x,0);
cặp[] dấu chấm = {A,B,C,D};
dấu chấm(dấu chấm);
draw(A--B--C--D--cycle);
xaxis(-2,9,Mũi tên(4));
yaxis(-2,7,Arrows(4));
nhãn("$A$",A,SW);
nhãn("$B$",B,NW);
nhãn("$C$",C,NE);
nhãn("$D$",D,SE);
nhãn("$x$",(B+C)/2,N);
label("$4$",(C+D)/2,E);[/asy]

